#include <Arduino.h>

//	Pin LED pada ESP32 
#define LED 2

//	Variabel untuk mengatur delay dalam milisecond (ms)
int jeda = 1000;

void setup() 
{
	//	Kode program yang berada di sini hanya dijalankan satu kali
  	Serial.begin(115200);
  	pinMode(LED, OUTPUT);
}

void loop() 
{
  	// 	Program utama yang dijalankan berulang kali
  	digitalWrite(LED, HIGH);
  	Serial.println("LED menyala.");
  	delay(jeda);
  	digitalWrite(LED, LOW);
  	Serial.println("LED padam.");
  	delay(jeda);
}

function solve() {
    let table = document.querySelector('table');
    let quickCheckBtn = document.querySelector('.buttons input[type="submit"]');
    let clearBtn = document.querySelector('.buttons input[type="reset"]');

    quickCheckBtn.addEventListener('click', function(e) {
        e.preventDefault();
        checkSudoku();
    })

    clearBtn.addEventListener('click', function(e) {
        e.preventDefault();
        clear();
    });

    function clear () {
        document.getElementById('check').textContent = "";
        let tableInputs = document.querySelectorAll('tbody tr td input');
        for (let input of tableInputs) {
            input.value = "";
        }
    }

    function checkSudoku () {
        let rowsColsArray = [];
        let tableRows = table.querySelectorAll('tr');
        let col1 = '';
        let col2 = '';
        let col3 = '';
        let isValid = true;

        for (let row of tableRows) {
            let currentRow = '';
            let rowValues = Array.from(row.querySelectorAll('td'));
            col1 += rowValues[0].querySelector('input').value;
            col2 += rowValues[1].querySelector('input').value;
            col3 += rowValues[2].querySelector('input').value;
            currentRow = rowValues[0].querySelector('input').value + rowValues[1].querySelector('input').value + rowValues[2].querySelector('input').value
            rowsColsArray.push(currentRow);
        }

        rowsColsArray.push(col1);
        rowsColsArray.push(col2);
        rowsColsArray.push(col3);

        for (let element of rowsColsArray) {
            if (!element.includes('1') || !element.includes('2') || !element.includes('3')) {
                isValid = false;
                break;
            }
        }

        if (isValid) {
            table.style.border = '2px solid green';
            document.getElementById('check').textContent = "Success!";
        } else {
            table.style.border = '2px solid red';
            document.getElementById('check').textContent = "Keep trying ...";
        }
    }
}

function solve() {
    const conversionMap = {
        km: 1000,
        m: 1,
        cm:	0.01,
        mm:	0.001,
        mi:	1609.34,
        yrd: 0.9144,
        ft:	0.3048,
        in: 0.0254,
    }

    let convertBtn = document.getElementById('convert');
    convertBtn.addEventListener('click', convertUnits);

    function convertUnits () {
        let inputUnit = document.getElementById('inputUnits').value;
        let inputValue = Number(document.getElementById('inputDistance').value);
        let outputUnit = document.getElementById('outputUnits').value;
        let outputField = document.getElementById('outputDistance');

        let inputValueInMeters = inputValue * Number(conversionMap[inputUnit]);
        let outputValue = inputValueInMeters / Number(conversionMap[outputUnit]);

        outputField.value = outputValue;
    }
}

function solve() {
  
	let tableBody = document.getElementsByTagName('tbody')[0];
  	let inputSubmit = document.getElementById('input').querySelector('input[type="submit"');
  	let checkBoxes = document.querySelectorAll('input[type="checkbox"]');

  	for (let checkBox of checkBoxes) {
    	checkBox.disabled = false;
  	}

	inputSubmit.addEventListener('click', function (e) {
		e.preventDefault();
		generateFurniture();
	})

	function generateFurniture() {
		let input = document.getElementById('input').querySelector('textarea').value;
		let inputArray = JSON.parse(input);
		
		for (let object of inputArray) {
		let image = object.img;
		let newImage = document.createElement('img');
		newImage.src = image;
		
		let name = object.name;
		let newName = document.createElement('p');
		newName.textContent = name;

		let price = object.price;
		let newPrice = document.createElement('p');
		newPrice.textContent = price;

		let decFactor = object.decFactor;
		let newDecFactor = document.createElement('p');
		newDecFactor.textContent = decFactor;

		let newRow = document.createElement('tr');
		let imageCell = document.createElement('td');
		imageCell.appendChild(newImage);
		newRow.appendChild(imageCell);

		let nameCell = document.createElement('td');
		nameCell.appendChild(newName);
		newRow.appendChild(nameCell);

		let priceCell = document.createElement('td');
		priceCell.appendChild(newPrice);
		newRow.appendChild(priceCell);
		
		let decFactorCell = document.createElement('td');
		decFactorCell.appendChild(newDecFactor);
		newRow.appendChild(decFactorCell);

		let chechBoxCell = document.createElement('td');
		let newCheckInput = document.createElement('input');
		newCheckInput.type = 'checkbox';
		newCheckInput.disabled = false;
		chechBoxCell.appendChild(newCheckInput);
		newRow.appendChild(chechBoxCell);

		tableBody.appendChild(newRow);
		}
	}
	
	let shopSubmit = document.getElementById('shop').querySelector('input[type="submit"');	
	shopSubmit.addEventListener('click', function (e) {
		e.preventDefault();
		generateOutput();
	})

	function generateOutput() {
		let tableRows = Array.from(document.querySelectorAll('tbody tr'));
		let boughtFurniture = [];
		let totalPrice = 0;
		let totalDecFactor = 0;

		for (let row of tableRows) {
			let checkBox = row.querySelector('td:last-child input[type="checkbox"]')
			if (checkBox.checked) {
				totalPrice += Number(row.querySelector('td:nth-of-type(3) p').textContent);
				totalDecFactor += Number(row.querySelector('td:nth-of-type(4) p').textContent);
				boughtFurniture.push(row.querySelector('td:nth-of-type(2) p').textContent);
			}
		}

		let avgDecFactor = (totalDecFactor / boughtFurniture.length);
		let shopTextArea = document.getElementById('shop').querySelector('textarea');

		let result = `Bought furniture: ${boughtFurniture.join(', ')}\nTotal price: ${totalPrice}\nAverage decoration factor: ${avgDecFactor}`
		shopTextArea.value = result;
	}

}

function solve() {
    let encodeBtn = document.getElementById('encode').querySelector('button');
    let decodeBtn = document.getElementById('decode').querySelector('button');

    encodeBtn.addEventListener('click', function (e) {
        encodeMsg();
        e.preventDefault();
    })

    decodeBtn.addEventListener('click', function (e) {
        decodeMsg();
        e.preventDefault();
    })

    function encodeMsg () {
        let message = document.getElementById('encode').querySelector('textarea').value;
        let ouputField = document.getElementById('decode').querySelector('textarea')
        let encodedMsg = ''
        for (let char of message) {
            let newCode = char.charCodeAt(0) + 1;
            encodedMsg += String.fromCharCode(newCode);
        }

        ouputField.value = encodedMsg;
        document.getElementById('encode').querySelector('textarea').value = '';
    }

    function decodeMsg () {
        let receivedMsg = document.getElementById('decode').querySelector('textarea').value;
        let decodedMsg = '';
        for (let char of receivedMsg) {
            let newCode = char.charCodeAt(0) - 1;
            decodedMsg += String.fromCharCode(newCode);
        }

        document.getElementById('decode').querySelector('textarea').value = decodedMsg;
    }

}

